e AWS account that an image has been shared with.</p>', 'UpdateWorkspaceImagePermissionRequest$SharedAccountId' => '<p>The identifier of the AWS account to share or unshare the image with.</p> <important> <p>Before sharing the image, confirm that you are sharing to the correct AWS account ID.</p> </important>', 'WorkspaceImage$OwnerAccountId' => '<p>The identifier of the AWS account that owns the image.</p>', ], ], 'BooleanObject' => [ 'base' => NULL, 'refs' => [ 'ConnectionAliasPermission$AllowAssociation' => '<p>Indicates whether the specified AWS account is allowed to associate the connection alias with a directory.</p>', 'DefaultWorkspaceCreationProperties$EnableWorkDocs' => '<p>Specifies whether the directory is enabled for Amazon WorkDocs.</p>', 'DefaultWorkspaceCreationProperties$EnableInternetAccess' => '<p>Specifies whether to automatically assign an Elastic public IP address to WorkSpaces in this directory by default. If enabled, the Elastic public IP address allows outbound internet access from your WorkSpaces when you’re using an internet gateway in the Amazon VPC in which your WorkSpaces are located. If you\'re using a Network Address Translation (NAT) gateway for outbound internet access from your VPC, or if your WorkSpaces are in public subnets and you manually assign them Elastic IP addresses, you should disable this setting. This setting applies to new WorkSpaces that you launch or to existing WorkSpaces that you rebuild. For more information, see <a href="https://docs.aws.amazon.com/workspaces/latest/adminguide/amazon-workspaces-vpc.html"> Configure a VPC for Amazon WorkSpaces</a>.</p>', 'DefaultWorkspaceCreationProperties$UserEnabledAsLocalAdministrator' => '<p>Specifies whether WorkSpace users are local administrators on their WorkSpaces.</p>', 'DefaultWorkspaceCreationProperties$EnableMaintenanceMode' => '<p>Specifies whether maintenance mode is enabled for WorkSpaces. For more information, see <a href="https://docs.aws.amazon.com/workspaces/lat